import React, {Component} from 'react'
import classes from './TaskDetail.module.css'

class TaskDetailHead extends Component{

	render(){
		return <div>
				<div className = {classes.taskDetailHead}>
					{this.props.title}
				</div>
			</div>;
	}

}

export default TaskDetailHead;
